/* Creazione socialmarket con sole tabelle presenti nel workload scelto per la progettazione fisica
(e senza vincoli) in modo tale da ottenere un'agevole inserimento con datanamic e, inoltre, evitare
la creazione di indici da parte di Postgre per poter lavorare in condizioni di partenza.
*/

SET search_path TO 'socialmarketshort';

-- DROP SCHEMA socialmarketshort CASCADE;
CREATE SCHEMA IF NOT EXISTS socialmarketshort;

CREATE TABLE VOLONTARI(
	cfV CHAR(16) NOT NULL,
	dataN DATE NOT NULL,
	cognomeV VARCHAR(20) NOT NULL,
	nomeV VARCHAR(20) NOT NULL,
	TelV VARCHAR(13) NOT NULL,
	veicolo VARCHAR(20),
	seTrasporta BOOL NOT NULL,
	seAccoglie BOOL NOT NULL,
	seScarica BOOL NOT NULL,
	dummyV TEXT
);

CREATE TABLE TURNI(
	idTurno SERIAL NOT NULL,
	dataTurno DATE NOT NULL,
	orarioInizio TIME NOT NULL,
	orarioFine TIME NOT NULL,
	cfV CHAR(16) NOT NULL,
	dummyT TEXT
);
	
CREATE TABLE INVENTARIO(
	idProdotto SERIAL NOT NULL,
	nomeProdotto VARCHAR(20) NOT NULL,
	tipologiaProdotto VARCHAR(20) NOT NULL,
	tolleranzaScadenza VARCHAR(20),
	quantitaInv INT NOT NULL,
	costoPunti INT NOT NULL,
	qtScaricato INT NOT NULL,
	dummyI TEXT
);

SET search_path TO 'socialmarketshort';
SET datestyle to 'MDY';






